result:
 Using the Pythagorean theorem, we can find the length of the hypotenuse (AC) as follows:
AC^2 = AB^2 + BC^2
8^2 = 10^2 + BC^2
64 = 100 + BC^2
BC^2 = 36
BC = \sqrt{36}
BC = 6
Now, we can find the sine of angle B using the length of the hypotenuse (AC) and the length of the side opposite to angle B (BC):
sinB = \frac{opposite}{hypotenuse}
sinB = \frac{6}{10}
sinB = \frac{3}{5}
The answer is: A

